import React, { useState } from 'react';
import Button from 'react-bootstrap/Button';
import Col from 'react-bootstrap/Col';
import Form from 'react-bootstrap/Form';
import Row from 'react-bootstrap/Row';
import axios from 'axios';
import { useRouter } from 'next/router';

function RegistrationForm() {
  const [SignUpForm, setSignUpForm] = useState({
    username: '',
    email: '',
    password: '',
    is_admin: false,
    is_customer: false,
    is_employee: false,
  });

  const [validated, setValidated] = useState(false);

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;
    setSignUpForm({
      ...SignUpForm,
      [name]: type === 'checkbox' ? checked : value,
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    const form = e.currentTarget;

    if (form.checkValidity() === false) {
      e.stopPropagation();
    }

    setValidated(true);

    if (form.checkValidity() === true) {
      try {
        const response = await axios.post('http://127.0.0.1:8000/register/', SignUpForm);
        console.log(response.data);
      } catch (error) {
        console.error(error);
      }
    }
  };

  

  return (
    <div style={{
      display: 'flex',
      justifyContent: 'center',
      alignItems: 'center',
      height: '100vh',
    }}>
      <div style={{
        width: '400px',
        border: '1px solid #ccc',
        padding: '20px',
        borderRadius: '5px',
        boxShadow: '0 0 10px rgba(0, 0, 0, 0.1)',
      }}>
        <Form noValidate validated={validated} onSubmit={handleSubmit}>
          <Form.Group as={Row} className="mb-3" controlId="formHorizontalUsername">
            <Form.Label column sm={3}>
              Username
            </Form.Label>
            <Col sm={9}>
              <Form.Control
                required
                type="text"
                name="username"
                value={SignUpForm.username}
                onChange={handleChange}
                placeholder="Username"
              />
              <Form.Control.Feedback type="invalid">
                Please enter a username.
              </Form.Control.Feedback>
            </Col>
          </Form.Group>

          <Form.Group as={Row} className="mb-3" controlId="formHorizontalEmail">
            <Form.Label column sm={3}>
              Email
            </Form.Label>
            <Col sm={9}>
              <Form.Control
                type="email"
                name="email"
                value={SignUpForm.email}
                onChange={handleChange}
                placeholder="Email"
              />
              <Form.Control.Feedback type="invalid">
                Please enter a valid email address.
              </Form.Control.Feedback>
            </Col>
          </Form.Group>

          <Form.Group as={Row} className="mb-3" controlId="formHorizontalPassword1">
            <Form.Label column sm={3}>
              Password
            </Form.Label>
            <Col sm={9}>
              <Form.Control
                required
                type="password"
                name="password"
                value={SignUpForm.password}
                onChange={handleChange}
                placeholder="Password"
              />
              <Form.Control.Feedback type="invalid">
                Please enter a password.
              </Form.Control.Feedback>
            </Col>
          </Form.Group>


          <Form.Group as={Row} className="mb-3">
            <Form.Label column sm={3}>
              User Type
            </Form.Label>
            <Col sm={9}>
              <Form.Check
                type="checkbox"
                label="Admin"
                name="is_admin"
                checked={SignUpForm.is_admin}
                onChange={handleChange}
              />
              <Form.Check
                type="checkbox"
                label="Customer"
                name="is_customer"
                checked={SignUpForm.is_customer}
                onChange={handleChange}
              />
              <Form.Check
                type="checkbox"
                label="Employee"
                name="is_employee"
                checked={SignUpForm.is_employee}
                onChange={handleChange}
              />
            </Col>
          </Form.Group>

          <Form.Group as={Row} className="mb-3">
            <Col sm={{ span: 10, offset: 2 }}>
              <Button type="submit">Register</Button>
            </Col>
          </Form.Group>
        </Form>
      </div>
    </div>
  );
}

export default RegistrationForm;
